import React from 'react';

function Menu(){
return(

<div> 
    <div className="menu">



                <form>
                    <div classsName="mb-3">
                      <label for="exampleInputEmail1" classsName="form-label">E-mail</label>
                      
                    </div>
                    <div classsName="mb-3">
                        <label for="exampleInputUser1" classsName="form-label">Primeiro Nome</label>
                       
                        <label for="exampleInputDate1" classsName="form-label">Data de Nascimento</label>
                        
                    </div>
                    <button type="submit" classsName="btn btn-primary">Enviar</button>
                  </form>
            </div>

    </div>


);

}

export default Menu;
